        {
            /// <summary>
            /// Base64文件内容检测正则
            /// </summary>
            Regex _regexBase64 = new Regex(@"^(?:(data:(?<contenttype>[^;]+);base64,)?(?<content>.+))$", RegexOptions.IgnoreCase);

            var test1 = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAATgAA";
            var test2 = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAATgAA=";
            var test3 = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAATgAA==";
            var test4 = "iVBORw0KGgoAAAANSUhEUgAAATgAA";
            var test5 = "iVBORw0KGgoAAAANSUhEUgAAATgAA=";
            var test6 = "iVBORw0KGgoAAAANSUhEUgAAATgAA==";
            var test7 = "iVBORw0KGgoAAAANSUhEUgAAATgAA===";

            var r1 = _regexBase64.IsMatch(test1);
            var r2 = _regexBase64.IsMatch(test2);
            var r3 = _regexBase64.IsMatch(test3);
            var r4 = _regexBase64.IsMatch(test4);
            var r5 = _regexBase64.IsMatch(test5);
            var r6 = _regexBase64.IsMatch(test6);
            var r7 = _regexBase64.IsMatch(test7);

            return Content("");

            var base64 = "data:image/png;base64,";

            var files = HttpContext.Request.Form.Files;

            UploadContext upContext = new UploadContext("http://localhost:27102/api/uploadify", new KeyValuePair<string, string>("test", base64), 0, "/upload/base64", false, null);
            upContext.AddFormFile(files);

            var result = upContext.Save().Result;

            string paths = string.Join(",", result.Select(p => p.FilePath).ToArray());

            return Content(paths);
        }
    }
